EvolveCondition:
right = Roulette.Get(column+1, row);
left = Roulette.Get(column-1, row);
if(left == right and left == 1001) then
  result = "Evolve("..column..","..row..", 1012)";
  return  result;
end
return "";

local result = "";
local format = "+Change(%d, %d, 0)"
local directionX = {0,0,-1,1};
local directionY = {1,-1,0,0};
for i = 1,4 do
    if(Roulette.Get(column + directionX[i], row + directionY[i]) == 1005) then
       result = result..string.format(format, column + directionX[i], row + directionY[i]);
    end
end
return result;
